import { useEffect } from 'react';
import { TweenMax } from 'gsap';

export interface FadeInProps {
  children: any;
}

const FadeIn: React.SFC<FadeInProps> = ({ children }) => {
  useEffect(() => {
    TweenMax.staggerFromTo(
      `.animate`,
      1,
      { y: -10, opacity: 0 },
      { y: 0, opacity: 1 },
      0.2
    );
  });

  return (
    <div className="animate">
      {children}
      <style jsx>{``}</style>
    </div>
  );
};

export default FadeIn;
